lumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"1204730","type":"CustomJS"},{"attributes":{"source":{"id":"1204343"}},"id":"1204586","type":"CDSView"},{"attributes":{"dimensions":"width","maintain_focus":false},"id":"1204368","type":"WheelZoomTool"},{"attributes":{"source":{"id":"1204343"}},"id":"1204610","type":"CDSView"},{"attributes":{"fill_alpha":{"value":0.1},"fill_color":{"value":"blue"},"hatch_alpha":{"value":0.1},"hatch_color":{"value":"blue"},"line_alpha":{"value":0.1},"line_color":{"value":"blue"},"size":{"value":8},"x":{"value":1258},"y":{"value":0.030912818104320214}},"id":"1204424","type":"Scatter"},{"attributes":{"toolbar":{"id":"1204816"}},"id":"1204817","type":"ToolbarBox"},{"attributes":{"line_color":{"value":"#bbbbbb"},"x0":{"field":"index"},"x1":{"field":"index"},"y0":{"field":"High"},"y1":{"field":"Low"}},"id":"1204593","type":"Segment"},{"attributes":{"overlay":{"id":"1204334"}},"id":"1204329","type":"BoxZoomTool"},{"attributes":{"data":{"Close":{"__ndarray__":"CVG+oIWnUEC+TBQhdSJQQBy3mJ8bDVBA08H6P4dfUEDKoxthUTZQQMdkcf+RWVBA1/fhICFRUEB2VDVB1HtQQJUsJ6H0sFBAi8ba39m/UEBTQNr/AGNQQDRlpx/UNFBAPsvz4O4lUEARxk/j3i5PQGbBxB9FhFBAa/RqgNJ8UEB5PC0/cLNQQMA9z582RVBAj/8CQYCqUEDrbwnAP4dQQHk/br98rFBAIv/MID7PUEAZkL3e/fJQQMd/gSBAFVFATiUDQBUtUUDlYDYBhjVRQFp/SwD+OVFA4ScOoN9KUUDgLZCg+DxRQMl2vp8aKlFA9KW3PxdzUUBu93KfHHBRQBqiCn+Gw1FAGLFPAMWgUUDvb9BefYFRQAtjC0EO
